import React from 'react';


const Navigation =({onRouteChange,isSignedIn})=>{


  
        
                if(isSignedIn){

                    return ( 
            <nav style={{display: 'flex' , justifyContent:'flex-end'}}>
            <p onClick={()=>onRouteChange('signin')} className='f3 link dim black underline pa3 pointer'>Deconnecter</p>
        </nav>
                    );
        }else{
            return ( 
         <nav style={{display: 'flex' , justifyContent:'flex-end'}}>
            <p onClick={()=>onRouteChange('home')} className='f3 link dim black underline pa3 pointer'>Connecter</p>
            <p onClick={()=>onRouteChange('signin')} className='f3 link dim black underline pa3 pointer'>S'inscrire</p>
        </nav>
            );
        }

       
        
        
    
}

export default Navigation ;
